import React from "react";
import { Layout } from "../components";
import { useQuery, gql } from "@apollo/client";

const TRACKS = gql`
  query getTracks {
    tracksForHome {
      id
      title
      author {
        id
        name
        photo
      }
      thumbnail
      length
      modulesCount
    }
  }
`;

<Layout grid>{JSON.stringify(data)}</Layout>

export default Tracks;
